【送料無料】<br><!-- エアコン標準設置工事費込 START --><!-- エアコン標準設置工事費込 END --><!-- 商品説明 ここから --><div class=cartRap><h3>商品説明</h3><p>★ 独立駆動の2つの新型ファンで、左右の床温度差最高3℃で同じ部屋に異なる温度空間を実現<br />左右独立駆動の新型ファンが風量を制御し、同じ部屋に異なる温度空間を実現<br />暖房運転時、左右での床面温度差最高3℃を実現<br /><br />★ センシング解像度の高いムーブアイ極で手足の指先の温度まで感知し、個人の温度感覚の違いを判断<br />左右方向の解像度を従来の4倍に高めたムーブアイ極が個人の手先・足先などの細部までの温度変化を測定<br />360°センシングのムーブアイ極で、体の部位の温度を0.1℃単位で細かく計測<br /><br />★ DCモーター搭載の新型ファンと大容量のW字型熱交換器の搭載で、最高峰の省エネ性能を実現<br />新型ファンはラインフローファンと比べてモーターの消費電力を同一風量時に31％削減し、APFを3.0％改善（5.6kWクラス）<br /><br />★ 独自の「ハイブリッドナノコーティング」と「はずせるボディ」でお手入れ簡単で清潔を維持<br />ホコリや油汚れに強い「ハイブリッドナノコーティング」を熱交換器・ファン・通風路に塗布<br />前面パネルやフラップなどの外観パーツが取り外し可能な「はずせるボディ」を採用し、簡単にお掃除可能</p></div><!-- 商品説明 ここまで --><!-- 商品仕様 ここから --><div class=cartRap><h3>スペック</h3><p>* 畳数の目安：おもに29畳<br />* 冷房能力：9.0kW<br />* 電源：単相200V<br />* 外形寸法…<br />　・室内機：幅890×高さ358×奥行285mm<br />　・室外機：幅800×高さ714×奥行285mm<br />* 質量…<br />　・室内機：22kg<br />　・室外機：44kg</p></div><!-- 商品仕様 ここまで --><!-- 共通説明文（大）-->
