【送料無料】<br><!-- エアコン標準設置工事費込 START --><!-- エアコン標準設置工事費込 END --><!-- 商品説明 ここから --><div class=cartRap><h3>商品説明</h3><p>★ 「ムーブアイ極」で個人の温度の感じ方を判断し、自動で「風あて」・「風よけ」を切り替えて快適性を向上<br />左右方向のセンシングをより細分化したことで、解像度を従来比※4倍に高めたセンサー「ムーブアイ極」を搭載（※2015年度Zシリーズとの比較）<br />・暑い、寒いといった温度感覚が現れやすい手先・足先など細部までの温度変化を測り、個人の温度の感じ方の違いを判断<br />・前後左右同時に風を吹き分ける「匠フラップ」により、暑い・寒いと判断した人に向けて風を届ける「風あて」運転で、すばやく快適に<br />・快適になった後は、「匠フラップ」でその人を包み込むような「風よけ」運転に自動で切り替え快適性を維持<br /><br />★ 「暖房」・「冷房」や「風あて」・「風よけ」もリモコンのボタンひと押しで自動設定<br />・タッチパネル液晶搭載リモコンにメニュー画面を一覧表示でき、直感的な操作を実現<br />・「自動」モードを新たに搭載し、「暖房」・「冷房」などの「運転モード」や「風あて」・「風よけ」もリモコンのボタンひと押しで自動設定<br />・「暖房」・「冷房」・「温度」・「切タイマー」設定のみを表示する「かんたんモード」にリモコン側面のスイッチで切り替えでき、より少ない選択項目から操作が可能<br /><br />★ 独自の「ハイブリッドナノコーティング」と「はずせるボディ」で、清潔を維持<br />・三菱独自 の「ハイブリッドナノコーティング」を室内機の熱交換器・ファン・通風路に塗布し、ホコリなどの付着を抑制<br />・前面パネルやフラップなどの外観パーツが取り外しできる「はずせるボディ」で、室内機の中まで簡単に掃除が可能<br />・「フィルターおそうじメカ」機能により、定期的にフィルターを自動で掃除して清潔を維持<br /><br />★ 快適と節電を両立する「ハイブリッド運転」<br /><br />★ お部屋の空気をきれいにする「ピュアミスト」と「帯電ミクロフィルター」</p></div><!-- 商品説明 ここまで --><!-- 商品仕様 ここから --><div class=cartRap><h3>スペック</h3><p>* 畳数の目安：おもに14畳<br />　・暖房：11～14畳 (18～23平方メートル)<br />　・冷房：11～17畳 (18～28平方メートル)<br />* 暖房能力：5.0kW (最小値0.6kW～最大値11.2kW)<br />* 外気温2℃時の暖房能力：8.1kW<br />* 冷房能力：4.0kW (最小値0.6kW～最大値5.3kW)<br />* 消費電力…<br />　・暖房時：970W (最小値105W～最大値3500W)<br />　・冷房時：960W (最小値105W～最大値1350W)<br />* 期間消費電力量：1097kWh/年　(JIS C 9612:2013)<br />* 通年エネルギー消費効率(APF)：6.9<br />* 電源：単相200V 20A / コンセント形状：エルバー型<br />* 外形寸法…<br />　・室内機：幅799×高さ295×奥行375mm<br />　・室外機：幅800×高さ714×奥行285mm<br />* 質量…<br />　・室内機：18kg<br />　・室外機：38kg<br />* 最大配管長：15m<br />* 配管最大高低差：10m<br />* 使用配管：2分3分配管</p></div><!-- 商品仕様 ここまで --><!-- 共通説明文（大）-->
