=cartRap><h3>スペック</h3><p>* 電源：単100V 20A<br />* 電源プラグ：IL型<br />* 畳数の目安：冷房 6～9畳／暖房 6～7畳<br />* 能力（kW）：冷房 2.2／暖房 2.5<br />* メーカー保証：1年間<br />* 室内機外形寸法/質量：高さ295×幅798×奥行370mm／質量15kg<br />* 室外機外形寸法/質量：高さ599×幅718（＋78）×奥行315（＋56）mm／質量30kg</p></div><!-- 商品仕様 ここまで --><!-- 共通説明文（大）-->
